"""Problem 26
A unit fraction contains 1 in the numerator.
The decimal representation of the unit fractions with denominators 2 to 10 are given:

1/2	= 	0.5
1/3	= 	0.(3)
1/4	= 	0.25
1/5	= 	0.2
1/6	= 	0.1(6)
1/7	= 	0.(142857)
1/8	= 	0.125
1/9	= 	0.(1)
1/10	= 	0.1
Where 0.1(6) means 0.166666..., and has a 1-digit recurring cycle. It can be seen that 1/7 has a 6-digit recurring cycle

Find the value of d < 1000 for which 1/d contains the longest recurring cycle in its decimal fraction part.
http://kvant.mccme.ru/pdf/2000/02/kv0200semenova.pdf -- formula"""
numerator = 10
iter = [i for i in range(11, 1000) if all(i % k != 0 for k in range(2, int(i**0.5)+1))]
for denominator in range(11, 1000):  # iter
    result = ""
    number = "inf"
    while len(result) < (denominator - 1):  #
        # print(numerator)
        number = str(numerator // denominator)
        result += number
        prev_numerator = numerator
        numerator = (numerator % denominator) * 10
        while numerator < denominator and numerator != 0:
            number = "0"
            result += number
            numerator *= 10
    numerator = 10
    search = ""
    prev_count = 0
    count = 0

    while len(result) != (denominator - 1):
        result = result[:-1]

    print("1/{} = {}".format(denominator, "0." + result), len(result))

